import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
  color: white;
`;

const Logo = styled.div`
  text-align: center;
  margin: 2rem 0;
  
  h1 {
    font-size: 4rem;
    margin: 0;
    font-weight: bold;
    
    span {
      color: #ff9000;
      background-color: #000;
      padding: 0.2rem 1rem;
      border-radius: 4px;
    }
  }
`;

const SearchSection = styled.div`
  text-align: center;
  margin: 3rem 0;
`;

const SearchBar = styled.input`
  width: 80%;
  max-width: 600px;
  padding: 1rem 2rem;
  border-radius: 25px;
  border: none;
  background-color: #1a1a1a;
  color: white;
  font-size: 1.2rem;
  
  &:focus {
    outline: 2px solid #ff9000;
  }
`;

const ProjectsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(280px, 1fr));
  gap: 2rem;
  margin-top: 3rem;
`;

const ProjectCard = styled.div`
  background-color: #1a1a1a;
  border-radius: 8px;
  overflow: hidden;
  transition: all 0.3s ease;
  cursor: pointer;
  border: 1px solid #333;
  
  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 5px 15px rgba(255, 144, 0, 0.2);
    border-color: #ff9000;
  }
`;

const ProjectImage = styled.img`
  width: 100%;
  height: 180px;
  object-fit: cover;
  border-bottom: 1px solid #333;
`;

const ProjectInfo = styled.div`
  padding: 1.5rem;
`;

const ProjectTitle = styled.h3`
  color: #ff9000;
  margin: 0 0 1rem 0;
  font-size: 1.4rem;
`;

const ProjectDescription = styled.p`
  color: #ccc;
  margin: 0 0 1rem 0;
  font-size: 0.9rem;
  line-height: 1.4;
`;

const ProjectStats = styled.div`
  display: flex;
  justify-content: space-between;
  color: #888;
  font-size: 0.9rem;
  padding-top: 1rem;
  border-top: 1px solid #333;
`;

const ProjectTag = styled.span`
  background-color: #ff9000;
  color: black;
  padding: 0.3rem 0.8rem;
  border-radius: 15px;
  font-size: 0.8rem;
  font-weight: bold;
`;

const Categories = styled.div`
  display: flex;
  gap: 1rem;
  margin: 2rem 0;
  justify-content: center;
  flex-wrap: wrap;
`;

const CategoryButton = styled.button`
  background-color: ${props => props.active ? '#ff9000' : '#1a1a1a'};
  color: ${props => props.active ? 'black' : 'white'};
  border: none;
  padding: 0.8rem 1.5rem;
  border-radius: 20px;
  cursor: pointer;
  font-weight: bold;
  
  &:hover {
    background-color: ${props => props.active ? '#ff7000' : '#252525'};
  }
`;

const Home = () => {
  const projects = [
    {
      description: "A Java-based collection of games including 2048 and Coin Toss with variable probabilities.",
      image: "https://repository-images.githubusercontent.com/768940493/c4f5bd2d-f1c1-4e0c-8e6c-f9c2e09a1f4b",
      views: "42",
      date: "May 2024",
      tech: "Java, Swing",
      link: "https://github.com/Lipp0s/Duracell"
    },
    {
      title: "LippHub",
      description: "Personal portfolio website built with React and styled-components.",
      image: "https://repository-images.githubusercontent.com/768940493/c4f5bd2d-f1c1-4e0c-8e6c-f9c2e09a1f4b",
      views: "12",
      date: "March 2024",
      tech: "React, JavaScript",
      link: "https://github.com/Lipp0s/LippHub"
    }
  ];

  return (
    <HomeContainer>
      <Logo>
        <h1><span>Lipp</span>Hub</h1>
      </Logo>
      
      <SearchSection>
        <SearchBar 
          type="text" 
          placeholder="Search projects..."
        />
        
        <Categories>
          <CategoryButton active>All</CategoryButton>
          <CategoryButton>Java</CategoryButton>
          <CategoryButton>Web</CategoryButton>
          <CategoryButton>Python</CategoryButton>
          <CategoryButton>Mobile</CategoryButton>
        </Categories>
      </SearchSection>

      <ProjectsGrid>
        {projects.map((project, index) => (
          <ProjectCard key={index} onClick={() => window.open(project.link, '_blank')}>
            <ProjectImage src={project.image} alt={project.title} />
            <ProjectInfo>
              <ProjectTitle>{project.title}</ProjectTitle>
              <ProjectDescription>{project.description}</ProjectDescription>
              <ProjectStats>
                <span>üëÅÔ∏è {project.views}</span>
                <span>üìÖ {project.date}</span>
                <ProjectTag>{project.tech}</ProjectTag>
              </ProjectStats>
            </ProjectInfo>
          </ProjectCard>
        ))}
      </ProjectsGrid>
    </HomeContainer>
  );
};

export default Home;
